description:
Ip Man  is a 2008 Hong Kong martial arts semi-biopic film that is based on the life of Ip Man, the celebrated martial arts master of Bruce Lee, and the first to teach the Chinese martial art of Wing Chun openly. The film focuses on events surrounding Ip that took place in the prefecture-level city of Foshan between the 1930s to 1940s during the Second Sino-Japanese War.
Directed by Wilson Yip, the film stars Donnie Yen in the lead role, and features fight choreography by Sammo Hung. Ip's two sons, Ip Chun and Ip Ching, along with several Wing Chun practitioners also appear in the film.













